import React from 'react'
import { Modal, Input, Button } from 'antd'
import './ModalInputPassword.less'

import logo from '@misc/logo/asset9.svg'

class ModalInputPassword extends React.PureComponent {

  handleSubmit = () => {
    this.props.verifyPassword(this.refs['input-password'].input.value)
  }

  render() {
    return (
      <Modal
        title="Basic Modal"
        className='modal-input-password'
        visible={this.props.visible}
        centered
      >
        <img src={logo} alt='icon_logo' />
        <Input.Password
          ref='input-password'
          placeholder="Input Password"
          onPressEnter={this.handleSubmit}
        />
        <Button
          type='primary'
          onClick={this.handleSubmit}
        >
          Join Conference
        </Button>
      </Modal>
    )
  }
}

export default ModalInputPassword
